--
-- 触发器 `operations`
--
DELIMITER $$
CREATE TRIGGER `update_stock_after_operation` AFTER INSERT ON `operations` FOR EACH ROW BEGIN
    IF NEW.type = 'IN' THEN
        UPDATE chemicals 
        SET quantity = quantity + NEW.quantity
        WHERE id = NEW.chemical_id;
    ELSE
        UPDATE chemicals 
        SET quantity = quantity - NEW.quantity
        WHERE id = NEW.chemical_id;
    END IF;
END
$$
DELIMITER ;

